import React from 'react';
import { BrowserRouter as Router, Link, Route } from 'react-router-dom';

// Componente para mostrar la lista de tareas
const TaskList = () => {
  const tasks = ['Tarea 1', 'Tarea 2', 'Tarea 3']; // Lista de tareas (puede ser obtenida desde una API)

  return (
    <div>
      <h1>Lista de Tareas</h1>
      <ul>
        {tasks.map((task, index) => (
          <li key={index}>{task}</li>
        ))}
      </ul>
      <Link to="/crear-tarea">Crear Nueva Tarea</Link>
    </div>
  );
};

// Componente para la página de creación de tarea
const CreateTask = () => {
  return (
    <div>
      <h1>Crear Nueva Tarea</h1>
      {/* Aquí puedes agregar el formulario para crear una nueva tarea */}
    </div>
  );
};

// Componente principal que contiene las rutas
const App = () => {
  return (
    <Router>
      <div>
        {/* Ruta para la lista de tareas */}
        <Route exact path="/" component={TaskList} />
        {/* Ruta para la creación de tarea */}
        <Route path="/crear-tarea" component={CreateTask} />
      </div>
    </Router>
  );
};

export default App;
